import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export const showSuccessMessage = success => <div className="">{toast(success)}<ToastContainer /></div>;
export const showErrorMessage = error => <div className="alert alert-danger">{toast(error)} <ToastContainer /></div>;
